angular.module("hermes_app").controller("visualizar_lote",function(t,e,a){t.lista_lotes=[],t.pagination={current_page:0,page_length:15,totalPages:function(){return t.lista_lotes?Math.ceil(t.lista_lotes.length/this.page_length):0},nextPage:function(){this.current_page+1<this.totalPages()&&this.current_page++},previousPage:function(){this.current_page-1>=0&&this.current_page--}},t.doSearch=function(){var n=new Date(t.search.startDate).getTime()/1e3,s=new Date(t.search.endDate).getTime()/1e3+86400;e({method:"get",url:"/api/smslote/search/dateinterval",params:{start:n,end:s}}).then(function(e){t.lista_lotes=e.data,toastr.info(t.lista_lotes.length+" registros encontrados!")},a.handle)}});